import { Component } from "react";
import { v4 as uuidv4 } from 'uuid'


export default function Home() {
 
  this.state = {
    data: [
      {
        id: uuidv4(),
        title: "mengerjakan Exercise",
        completed: true,
      },
      {
        id: uuidv4(),
        title: "mengerjakan Assigment",
        completed: false,
      },
    ],
  };
    return(
      <div>
      Home
      </div>
    )
  }
